def fromrna_toprotein(rna_sequence):
    
    genetic_code = {
            "UUU":"F", "UUC":"F", "UUA":"L", "UUG":"L",
            "UCU":"S", "UCC":"S", "UCA":"S", "UCG":"S",
            "UAU":"Y", "UAC":"Y", "UAA":"Stop", "UAG":"Stop",
            "UGU":"C", "UGC":"C", "UGA":"Stop", "UGG":"W",
            "CUU":"L", "CUC":"L", "CUA":"L", "CUG":"L",
            "CCU":"P", "CCC":"P", "CCA":"P", "CCG":"P",
            "CAU":"H", "CAC":"H", "CAA":"Q", "CAG":"Q",
            "CGU":"R", "CGC":"R", "CGA":"R", "CGG":"R",
            "AUU":"I", "AUC":"I", "AUA":"I", "AUG":"M",
            "ACU":"T", "ACC":"T", "ACA":"T", "ACG":"T",
            "AAU":"N", "AAC":"N", "AAA":"K", "AAG":"K",
            "AGU":"S", "AGC":"S", "AGA":"R", "AGG":"R",
            "GUU":"V", "GUC":"V", "GUA":"V", "GUG":"V",
            "GCU":"A", "GCC":"A", "GCA":"A", "GCG":"A",
            "GAU":"D", "GAC":"D", "GAA":"E", "GAG":"E",
            "GGU":"G", "GGC":"G", "GGA":"G", "GGG":"G"
    }
    
    protein_sequence = ''
    i = 0

    '''
    for i in range(0,len(rna_sequence),3):
        protein = genetic_code.get(rna_sequence[i:i+3])
        protein_sequence += protein

    protein_sequence = protein_sequence[start_codon:end]
    return protein_sequence
   ''' 
    
    while i < len(rna_sequence):
        codon = rna_sequence[i:i+3]
        amino_acid = genetic_code.get(codon, None)
        if amino_acid == "Stop":
            break  # Stop codon signals the end of translation
        if amino_acid is not None:
            protein_sequence += amino_acid
        i += 3
    
    return protein_sequence
     
rna_sequence = ""
protein = fromrna_toprotein(rna_sequence)
print(protein)
    